import React from 'react';
import './Button.css';

const  Button = (props) => {
   myClasses = `${props.cls}`
   return (
      <button
         type="button"
         className={props.cls}
         className="Button"
         onClick={props.clicked}
      >
         {props.value}
      </button>
   )
};

export default Button;
